import logo from './pluginIcon.png';
import './App.css';
import React from 'react';
import { useState, useEffect } from 'react';


function App() {

  // Declare state variable
  const [txtData, setTxtData] = useState("En cours de chargement...");

  // Declare useEffect to fetch content of the text file
  useEffect(() => {
    fetch(process.env.PUBLIC_URL + "/input.txt")
    .then(r => r.text())
    .then(text => {
      setTxtData(text.split("\n"))
    });
  }, [])

  for (const element of txtData) {
    // Perform any operations with 'element' here
    var txtArray = txtData;
    //console.log(element);
  }

  /*
  while (i < txtData.length) {
      txtData = txtData + "<br />"
